// static
bool TCPServerSocketStubDispatch::AcceptWithResponder(TCPServerSocket* impl, mojo::Message* message, std::unique_ptr<mojo::MessageReceiverWithStatus> responder)
{
    [[maybe_unused]] const bool message_is_sync = message->has_flag(mojo::Message::kFlagIsSync);
    [[maybe_unused]] const uint64_t request_id = message->request_id();
    switch (static_cast<messages::TCPServerSocket>(message->header()->name)) {
    case messages::TCPServerSocket::kAccept: {
        internal::TCPServerSocket_Accept_Params_Data* params = reinterpret_cast<internal::TCPServerSocket_Accept_Params_Data*>(message->mutable_payload());

        // Validation for TCPServerSocket.0
        bool success = true;
        ::mojo::PendingRemote<SocketObserver> p_observer {};
        TCPServerSocket_Accept_ParamsDataView input_data_view(params, message);

        if (success) {
            p_observer = input_data_view.TakeObserver<decltype(p_observer)>();
        }
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, TCPServerSocket::Name_, 0, false);
            return false;
        }
        TCPServerSocket::AcceptCallback callback = TCPServerSocket_Accept_ProxyToResponder::CreateCallback(*message, std::move(responder));
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->Accept(std::move(p_observer), std::move(callback));
        return true;
    }
    }
    return false;
}
